def doc_doc_details(request, values=None):
  no_emp_list = ListCekdoc.objects.values_list('emp_number', flat=True).distinct()
  group_by_values = []
  for values in no_emp_list:
    status_docs = ListCekdoc.objects.filter(emp_number=values)
    group_by_values.append({
      'nik':values,
      'status':[doc.status for doc in status_docs]
    })
  print(group_by_values)
  context = {'group_by_values': group_by_values}
  return render(request, 'emp/list_doc_detail.html', context)

