model saya:

from django.db import models
from django.utils import timezone


class Attacker(models.Model):
  nick=models.CharField(max_length=50, unique=True)
  def __str__(self):
    return self.nick

class Team(models.Model):
  name=models.CharField(max_length=50, unique=True)
  def __str__(self):
    return self.name

#Archive or Onhold
class Category(models.Model):
  kategori=models.CharField(max_length=10, unique=True)
  def __str__(self):
    return self.kategori


#Home or No
class Home(models.Model):
  index=models.CharField(max_length=3, unique=True)
  def __str__(self):
    return self.index


#Special domain
class Special(models.Model):
  khusus=models.CharField(max_length=3, unique=True)
  def __str__(self):
    return self.khusus

class Country(models.Model):
  negara=models.CharField(max_length=40, unique=True)
  def __str__(self):
    return self.negara

class Proof(models.Model):
  poc=models.CharField(max_length=50, unique=True)
  def __str__(self):
    return self.poc


class Notif(models.Model):
  url=models.URLField(max_length=200)
  domain=models.CharField(max_length=75, unique=True)
  ip_address=models.CharField(max_length=30)
  web_server=models.CharField(max_length=30)
  country=models.ForeignKey(Country, on_delete=models.CASCADE)
  special=models.ForeignKey(Special, on_delete=models.CASCADE)
  home=models.ForeignKey(Home, on_delete=models.CASCADE)
  category=models.ForeignKey(Category, on_delete=models.CASCADE)
  team=models.ForeignKey(Team, on_delete=models.CASCADE)
  attacker=models.ForeignKey(Attacker, on_delete=models.CASCADE)
  content=models.TextField()
  date_notif=models.DateTimeField(default=timezone.now)
  proof=models.ForeignKey(Proof, on_delete=models.CASCADE)

  class Meta:
    ordering=['-date_notif']

  def __str__(self):
    return self.domain
